`,b.jsxs(Yn,{classes:"full-width content-grid",children:[b.jsx(e.h2,{children:"Sprache einschrnken"}),b.jsxs(e.p,{children:["Meistens mchten wir nicht mit der ganzen Sprache arbeiten, sondern nur mit einer Untermenge. Das haben wir bereits gesehen, als wir mit Binrzahlen und auch im Hexadezimalsystem gearbeitet haben. Im Hexadezimalsystem, haben wir gesagt, dass und nur 2-stellige Zahlen interessieren. Wenn wir eine solche Einschrnkung auf die Sprache machen, dann mssen wir dafr eine Grammatik definieren. Die Grammatik wird in mehreren Regeln definiert. Diese Regeln knnen wir mit ",b.jsx(e.strong,{children:"Syntaxdiagrammen"})," beschreiben. Dazu machen wir gleich ein Beispiel fr 2-stellige Hexadezimalzahlen:"]}),b.jsx(e.p,{children:b.jsx(e.strong,{children:"Hexzahl:"})}),b.jsx(r0,{children:String.raw`
